import { useEffect } from "react";
import { motion } from "framer-motion";

export default function Homepage() {
  useEffect(() => {
    document.title = "Finlytiq LLP | Intelligence Behind Every Financial Move";
  }, []);

  return (
    <div className="bg-[#F9FAFB] text-[#0E101C]">
      {/* Navbar */}
      <div className="flex justify-between items-center p-6 shadow-sm bg-white sticky top-0 z-50">
        <h1 className="text-xl font-bold text-[#4B2EFF]">Finlytiq</h1>
        <div className="space-x-6 text-sm font-medium">
          <a href="#services" className="hover:text-[#4B2EFF]">Services</a>
          <a href="#about" className="hover:text-[#4B2EFF]">About</a>
          <a href="#contact" className="hover:text-[#4B2EFF]">Contact</a>
        </div>
      </div>

      {/* Hero Section */}
      <div className="min-h-[80vh] flex flex-col justify-center items-center text-center px-4">
        <motion.h2
          className="text-3xl md:text-5xl font-extrabold mb-4"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          Intelligence Behind Every Financial Move
        </motion.h2>
        <p className="text-sm md:text-base text-gray-600 mb-6">
          Professional Virtual CFO services for startups & growing businesses.
        </p>
        <a
          href="#contact"
          className="bg-[#4B2EFF] text-white px-6 py-2 rounded-full text-sm hover:bg-[#3723e2] transition"
        >
          Book a Free Consultation
        </a>
      </div>

      {/* Services */}
      <div id="services" className="py-16 px-6 md:px-20 bg-white">
        <h3 className="text-2xl font-semibold text-center mb-10">Our Services</h3>
        <div className="grid md:grid-cols-3 gap-6">
          {[
            {
              title: "Virtual CFO",
              desc: "End-to-end financial oversight, MIS, budgeting & investor reporting.",
            },
            {
              title: "Tax & Compliance",
              desc: "Income Tax, GST, ROC, TDS compliance handled accurately & timely.",
            },
            {
              title: "Startup Consulting",
              desc: "Pitch deck, business model validation, MCA, DPIIT & funding support.",
            },
          ].map((s, idx) => (
            <div
              key={idx}
              className="bg-[#F9FAFB] p-6 rounded-2xl shadow hover:shadow-md transition"
            >
              <h4 className="text-lg font-semibold mb-2 text-[#4B2EFF]">{s.title}</h4>
              <p className="text-sm text-gray-700 leading-relaxed">{s.desc}</p>
            </div>
          ))}
        </div>
      </div>

      {/* About */}
      <div id="about" className="bg-gray-100 py-20 px-6 md:px-32">
        <h3 className="text-2xl font-semibold text-center mb-6">About Us</h3>
        <p className="text-gray-700 max-w-3xl mx-auto text-center leading-loose">
          Finlytiq LLP is a professional financial consulting firm helping startups and SMEs scale
          confidently. From virtual CFO services to automated compliance and smart tax planning,
          we are your partners in financial clarity and control.
        </p>
      </div>

      {/* Contact */}
      <div id="contact" className="py-20 px-6 md:px-32 bg-white">
        <h3 className="text-2xl font-semibold text-center mb-8">Contact Us</h3>
        <form className="grid md:grid-cols-2 gap-6 max-w-3xl mx-auto">
          <input type="text" placeholder="Your Name" className="p-3 rounded border" required />
          <input type="email" placeholder="Email" className="p-3 rounded border" required />
          <textarea
            placeholder="Your Message"
            className="p-3 rounded border md:col-span-2"
            rows={5}
          ></textarea>
          <button
            type="submit"
            className="bg-[#4B2EFF] text-white px-6 py-2 rounded hover:bg-[#3723e2] transition md:col-span-2"
          >
            Submit
          </button>
        </form>
      </div>

      {/* Footer */}
      <footer className="text-center py-6 bg-gray-50 text-sm text-gray-500">
        Â© {new Date().getFullYear()} Finlytiq LLP. All rights reserved.
      </footer>
    </div>
  );
}
